IF OBJECT_ID('dbo.proc_transform_157', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_157;
GO
CREATE PROCEDURE dbo.proc_transform_157
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_157
    SET payload = LEFT(payload, 1000) + N'|V4-157|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_157;
END
